import SharedContext from './SharedContext';
import {AppBar, Toolbar, IconButton, Box, TextField, Navigate} from '@mui/material';
import DensityMediumIcon from '@mui/icons-material/DensityMedium';
import MailOutlineIcon from '@mui/icons-material/MailOutline';
import PersonIcon from '@mui/icons-material/Person';
/*
const styles = {
  rightButtons: {
    float: 'right',
  },
};*/

const AuthenticatedRoute = ({children}) => {
  if (localStorage.getItem('user')) {
    return children;
  }
  return <Navigate to="/login" replace />;
};

/**
 * @return {object} JSX
 */
function TopBar() {
  const logout = () => {
    localStorage.removeItem('user');
  };

  const desktop = false;
  return (
    <AuthenticatedRoute >
    <SharedContext.Consumer>
      {({mailbox}) => (
        <AppBar position='fixed'>
          <Toolbar sx={{justifyContent: 'space-between'}}>
            <IconButton
              role='button'
              aria-label='toggle drawer'>
              <DensityMediumIcon />
            </IconButton>
            {desktop&&'CSE186 Mail - '`${mailbox}`}
            <Box sx={{width: '70%'}}>
              <TextField
                margin="normal"
                id="search"
                name="search"
                size='small'
                fullWidth
                sx={{background: 'white'}}
              />
            </Box>
            <div>
            <IconButton
              role='button'
              aria-label='compose'>
              <MailOutlineIcon />
            </IconButton>
            <IconButton
              role='button'
              aria-label='compose'
              onClick={logout}>
              <PersonIcon />
            </IconButton>
            </div>
          </Toolbar>
        </AppBar>
      )}
    </SharedContext.Consumer>
    </AuthenticatedRoute>
  );
}

export default TopBar;
